import styled from 'styled-components';


export const FooterStyle = styled.footer`


    position: fixed;
    bottom: 0;
    width: 100%;
    height: 4rem;
    align-items: center;



`

export const ContactItem = styled.span`

    p, a{
        display: inline; 
        font-size: 20px;
        margin-left: 1rem;

    }

    a:hover {
        color: rgb(226, 167, 254);
    }   
`
